export enum Tags {
  WINTER,
  SUMMER,
  FALL,
  SPRING,
  TANK_SHIRT,
  T_SHIRT,
  LONG_SLEEVE_SHIRT,
  SHORT_PANTS,
  LONG_PANTS,
  JEANS,

}

export namespace Role {

  export function keys(): Array<string>{
    var keys = Object.keys(Role);
    return keys.slice(keys.length / 2, keys.length-1);
  }
}
